import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
    appBar: {
        borderRadius: 0,
        margin: 0,
        display: "flex",
        flexDirection: "row",
    },
    typography: {
        padding: "10px",
        borderRadius: 0
    }
}))
